import React, { Component } from 'react';
import photograph from '../statics/ProfilePhotograph.png';

export default class Description extends Component {
  render() {
    return (
      <div className="description">
        <img className="photograph" src={ photograph } alt=""/>
        <div className="my-description">
          <h2>WHO I AM ?</h2>
          <p>Since January 2021 I'm owner in Pão Suíço Bakery, in Contagem city, Minas Gerais state, Brasil. I've 21 years</p>
        </div>
      </div>
    )
  }
}
